import { Container, Row, Col } from "react-bootstrap";

function HomeContent() {
  return (
    <Container fluid>
      <Row>
        <Col className="colFilms">FILMS</Col>
        <Col className="colActors">ACTORS</Col>
      </Row>
    </Container>
  )
}

  export default HomeContent;
